name: NotEqualL
type: function
namespace: Microsoft.Quantum.Logical
summary: Restituisce true se e solo se due input non sono uguali.
remarks: >-
  Gli elementi seguenti sono equivalenti:


  ```Q#

  let cond = a != b;

  let cond = NotEqualL(a, b);

  ```
syntax: 'function NotEqualL (a : BigInt, b : BigInt) : Bool'
